import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import PaginaDeLogin from './components/PaginaDeLogin';
import PaginaDeCadastro from './components/PaginaDeCadastro';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/login" component={PaginaDeLogin} />
        <Route path="/cadastro" component={PaginaDeCadastro} />
      </Switch>
    </Router>
  );
};

export default App;
